import './App.css';


const App = () =>{
   const[counter,setCounter]=useState();
  return (
    <div className="App">
      <button onClick={() => setCounter((prevCount) => prevCount-1)}>-</button>
      <button>{counter}</button>
      <button onClick={() => setCounter((prevCount) )}>+</button>

    </div>
  );
}

export default App;
